import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import * as serviceWorker from './serviceWorker';

var express = require('express');
var app = express();
ReactDOM.render(<App/>, document.getElementById('app'));
serviceWorker.unregister();


module.exports = app;
